import "./Rt.css";
import axios from "axios"
import { useState, useEffect } from 'react'

const Rt = () => {

  // 데이터 가져오는 함수 
    const [myRtData, myRtSetData] = useState([]) // 데이터를 저장할 상태
    const [otherRtData, otherRtSetData] = useState([]) // 데이터를 저장할 상태
    const [storeList, storeListSetData ] = useState([])
    const csrfToken = "87D711B086463B79422F3BE8478346FA"; // CSRF 토큰

    // 지시요청 조회 데이터 요청 함수
    const getMyRtData = async () => {
      try {
        const response = await axios.get('http://localhost:8080/api/rt/meToOtherRtlist', {
          withCredentials: true,
          maxRedirects: 0, // 리다이렉션 방지
          headers: {
            'X-CSRF-TOKEN': csrfToken,
          },
        });
        myRtSetData(response.data); // 데이터를 상태에 저장
      } catch (err) {
        if (err.response && err.response.status === 302) {
          console.error('리다이렉션 발생:', err.response.headers.location);
        } else {
          console.error('Error:', err);
        }
      }
    }
    // 지시요청 조회 데이터 요청 함수
    const getOtherRtData = async () => {
      try {
        const response = await axios.get('http://localhost:8080/api/rt/OtherToMeRtlist', {
          withCredentials: true,
          maxRedirects: 0, // 리다이렉션 방지
          headers: {
            'X-CSRF-TOKEN': csrfToken,
          },
        });
        otherRtSetData(response.data); // 데이터를 상태에 저장
      } catch (err) {
        if (err.response && err.response.status === 302) {
          console.error('리다이렉션 발생:', err.response.headers.location);
        } else {
          console.error('Error:', err);
        }
      }
    }

    const getStoreListData = async () => {
      try {
        const response = await axios.get('http://localhost:8080/api/rt/store', {
          withCredentials: true,
          maxRedirects: 0, // 리다이렉션 방지
          headers: {
            'X-CSRF-TOKEN': csrfToken,
          },
        });
        storeListSetData(response.data); // 데이터를 상태에 저장
      } catch (err) {
        if (err.response && err.response.status === 302) {
          console.error('리다이렉션 발생:', err.response.headers.location);
        } else {
          console.error('Error:', err);
        }
      }
    }

    useEffect(() => {
      getMyRtData()
      getOtherRtData()
      getStoreListData()
    }, []);

    console.log(storeList)
  return(

    <div className="rtPage">
      <h1>매장 RT 관리 </h1>
      <hr />
      <div className="mainContent">

        <div className="searchBar">
          <div className="date">
            <label className="name">지시기간</label>
            <input id="input_date" type="date" />
          </div>

          <div className="checkbox">
            <label className="name">처리구분</label>
            <span className="fristCheckbox">
              <label>미확정</label>
              <input type="radio" />
            </span>
            <span>
              <label>확정</label>
              <input type="radio" />
            </span>
            <span>
              <label>불이행</label>
              <input type="radio" />
            </span>
          </div>

          <div className="selector">
            <label className="name">매장</label> 
            <select>
              {/* <option>매장 선택</option>
              {storeList.map((name, input) => 
                return (
                  <option>{name}</option>
                )
                )} */}


            </select>
          </div>

          <div className="buttons">
            <button id="searchButton">조회</button>
            <button id="createButton">등록</button>
          </div>
        </div>

        <div className="searchTable">
          <div className="tableName">
            <h3>지시요청 조회</h3>  
          </div>
          <table>
            <thead>
              <tr>
                <th>품번</th>
                <th>품명</th>
                <th>색상</th>
                <th>사이즈</th>
